import Cookies from 'js-cookie';

const isCookieExpired = (cookieName) => {
    const cookieValue = Cookies.get(cookieName);

    // If cookie doesn't exist or is empty, consider it expired
    if (!cookieValue) {
        return true;
    }

    const cookieDate = new Date(cookieValue);
    const now = new Date();

    // Calculate the difference in milliseconds between now and the cookie date
    const diffMilliseconds = now - cookieDate;

    // Convert milliseconds to hours
    const diffHours = diffMilliseconds / (1000 * 60 * 60);

    // Check if the difference is greater than 1 hour
    return diffHours > 1;
};

// Usage example:
if (isCookieExpired('dateTime')) {
    console.log('Cookie is older than 1 hour');
} else {
    console.log('Cookie is still valid');
}
